  // Get the value of the 'id' parameter from the URL
  const { id } = useParams();

  console.log(id)
  return (
    <div>
      <h1>Recipe for ID: {id}</h1>
      {/* You can use the 'id' parameter to fetch data or render specific content */}
    </div>
  );
}

export default IndividualRecipe;

// In your routing configuration, use a dynamic route like this:
<Route path="/:id" element={<IndividualRecipe />} />
